import React, { Component } from 'react';
import {withRouter} from 'react-router-dom';
import {Container, Row, Col, Navbar,Image} from 'react-bootstrap';
import {Animated} from "react-animated-css";
import {AnimatedOnScroll} from "react-animated-css-onscroll";
import './Works.css'

class Works extends Component {

    constructor(props){
        super(props);
        props.callbackPage(props.location.pathname);
    }
    render() {
        return (
            <div>
                <div className='works'></div>
                <div className='works-central'></div>

                <div className='works-menu'> 
                    <Container fluid align='center'>
                        <Row>
                            <Col><a href="#clothes" className='menu-link'> CLOTHES </a></Col>
                            <Col><a href="#painting" className='menu-link'> PAINTING s</a></Col>
                            <Col><a href="#music" className='menu-link'> MUSIC </a></Col>
                            <Col><a href="#tattoo" className='menu-link'> TATTOO </a></Col>
                            <Col><a href="#dance" className='menu-link'> DANCE </a></Col>
                        </Row>
                    </Container>
                </div>


                <Container>
                    <h1 id="clothes" className='works-h1' align='center'>CLOTHES</h1>
                    <h1 id="painting" className='works-h1' align='center'>PAINTING</h1>
                    <h1 id="music" className='works-h1' align='center'>MUSIC</h1>
                    <h1 id="tattoo" className='works-h1' align='center'>TATTOO</h1>
                    <h1 id="dance" className='works-h1' align='center'>DANCE</h1>
                </Container>

                <footer className='other-footer' align="center">@BKF2020 by Stadler Raphael</footer>
            </div>
        );
    }
}

export default Works;
